import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import HeaderImage from '../assets/images/headerImage.jpg'; // Replace with your header image path
import '../styles/learn.css'; // Import your custom CSS file for additional styling

function LearnOne() {
  return (
    <div className="learn-one-container">
      {/* Header Section with Image */}
      <div className="header-section">
        <img src={HeaderImage} alt="Header" className="img-fluid" />
      </div>

      {/* Content Section */}
      <Container className="content-section py-5">
        <Row>
          <Col>
            <h1 className="text-center mb-4">Title of LearnOne Page</h1>
            <p className="text-justify">
              Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer nec odio. Praesent libero. Sed cursus ante dapibus diam. Sed nisi. Nulla quis sem at nibh elementum imperdiet.
            </p>
            <p className="text-justify">
              Duis sagittis ipsum. Praesent mauris. Fusce nec tellus sed augue semper porta. Mauris massa.
            </p>
            {/* More structured text or content */}
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default LearnOne;
